pragma solidity 0.8.17;

import "@openzeppelin/contracts/access/Ownable.sol";

import "./lib/MathUtils.sol";
import "../../oracle/price/interfaces/IPriceOracle.sol";

import {IPLAYA3ULLNFT} from "./interfaces/I3ULLNFT.sol";
import {IPLAYA3ULLNFTMinterEventsAndErrors} from "./interfaces/I3ULLNFTMinterEventsAndErrors.sol";

import "hardhat/console.sol";

/**
 * @title PLAYA3ULL Games 3ULL NFT Minter Contract
 * @author Jourdan (PLAYA3ULL)
 * @notice This contract contains the core minting functionality for
 *         ordinary users minting the 3ULL NFT tokens.
 *         Additionally, this contract handles the pricing data and
 *         model for said 3ULL NFTs.
 */
contract PLAYA3ULLNFTMinter is Ownable, IPLAYA3ULLNFTMinterEventsAndErrors {
    /// @notice Whether users can mint from this contract.
    bool public mintActive;

    /// @notice The actual PLAYA3ULL NFT that is to be purchased.
    IPLAYA3ULLNFT public nft;

    /// @notice The interface for the Price Oracle to retrieve
    ///         pricing data from.
    IPriceOracle public oracle;

    /// @dev The lowest price a token can be purchased for.
    uint256 private price;

    /// @dev The scaling factor applied to an attributes rarity when
    ///      determining the price for that attribute.
    uint256 private rarityScaleFactor;

    constructor(address _nft, address _oracleAddress, uint256 _price) {
        nft = IPLAYA3ULLNFT(_nft);
        oracle = IPriceOracle(_oracleAddress);

        price = _price;

        mintActive = false;
        rarityScaleFactor = 1025000; // 1.02500
    }

    /**
     * @notice Returns the base price for a category. For example,
     *         if there are 10 categories, then the value returned
     *         will be the `price` / 10.
     *
     * @return The base price for each category.
     */
    function getBasePrice() public view returns (uint256) {
        uint256 traits = nft.getTraitLength();

        return price / traits;
    }

    /**
     * @notice Computes and returns the price for a given attribute
     *         of a given trait.
     *
     * @param _traitId  The ID of the trait that the attribute
     *                  belongs to.
     * @param _attrId   The ID of the attribute to compute the price.
     *
     * @return The computed price of the attribute.
     */
    function getAttributePrice(
        uint256 _traitId,
        uint256 _attrId
    ) public view returns (uint256) {
        IPLAYA3ULLNFT.Trait memory trait = nft.getTrait(_traitId);

        // The attribute is "None", therefore no price
        if (!trait.required && _attrId == 0) {
            return 0;
        }

        IPLAYA3ULLNFT.Attribute memory attribute = nft.getAttribute(
            _traitId,
            _attrId
        );

        uint256 maxSupply = nft.getMaxSupply();
        uint256 basePrice = getBasePrice();
        uint256 expectedTotal = ((maxSupply * 1e18) * attribute.rarity) / 1e18;
        uint256 expectedRarityFactor = (expectedTotal * rarityScaleFactor) /
            1e18;
        uint256 minOneSell = uint256(MathUtils.max(attribute.numSold, 1));
        uint256 normalised = MathUtils.canSub(
            1e18,
            ((minOneSell * 1e24) / expectedRarityFactor)
        )
            ? 1e18 - ((minOneSell * 1e24) / expectedRarityFactor)
            : 100000000000000; // 100000000000000 = 0.0001
        uint256 logOfNormal = MathUtils.abs(MathUtils.log2(int256(normalised)));

        return ((basePrice *
            (1e18 + logOfNormal) *
            (1e18 +
                ((((minOneSell * 1e36) / expectedTotal) *
                    (1e18 + (1e18 - normalised))) / 1e18))) / (1e36));
    }

    /**
     * @notice Retrieves the current price of 3ULL from the Price
     *         Oracle.
     *
     * @param _price    The USD price to get in 3ULL.
     *
     * @return The input price in 3ULL.
     */
    function getBullPrice(uint256 _price) public view returns (uint256) {
        return oracle.getPriceIn("USDC", "3ULL", _price);
    }

    /**
     * @notice Attempts to mint a token for the given address.
     *
     * @param to        The receiving address of the token.
     * @param traitIds  An array of indices of attributes, the
     *                  length of which must be equal to the
     *                  number of traits.
     */
    function mint(address to, uint256[] memory traitIds) external payable {
        _assertMintActive();

        // The total price of this NFT based on each attribute
        uint256 nftPrice = 0;

        // Check if the provided traits and attributes list is within the bounds of the contracts traits and attributes
        for (uint8 i = 0; i < traitIds.length; ) {
            IPLAYA3ULLNFT.Trait memory trait = nft.getTrait(i);
            if (traitIds[i] >= trait.maxCount || traitIds[i] < 0) {
                revert TraitsOutOfBounds(i, 0, trait.maxCount);
            }

            unchecked {
                nftPrice += getAttributePrice(i, traitIds[i]);
                i++;
            }
        }

        uint256 expectedPrice = nftPrice == 0 ? 0 : getBullPrice(nftPrice);
        if (msg.value != expectedPrice) {
            revert InsufficientValueProvided(expectedPrice);
        }

        nft.mint(to, traitIds);
    }

    /**
     * @notice Toggles whether minting is active or inactive.
     */
    function toggleActive() external onlyOwner {
        mintActive = !mintActive;
        emit ToggledMinting(mintActive);
    }

    /**
     * @notice Sets the base expected price for when minting tokens.
     *
     * @param _price    The new price that is being set.
     */
    function setPrice(uint256 _price) external onlyOwner {
        price = _price;
        emit PriceUpdated(price);
    }

    /**
     * @notice Allows the owner to withdraw deposited funds.
     *
     * @param amount    The amount of funds to withdraw.
     */
    function withdraw(uint256 amount) external onlyOwner {
        _assertEnoughFunds(amount);
        payable(msg.sender).transfer(amount);
    }

    /**
     * @dev Internal function to revert if the owner attempts to withdraw
     *      more funds than the contract balance contains.
     *
     * @param requestedAmount   The amount that is being withdrawn from
     *                          the contract.
     */
    function _assertEnoughFunds(uint256 requestedAmount) internal view {
        if (requestedAmount > address(this).balance) {
            revert NotEnoughFunds(address(this).balance);
        }
    }

    /**
     * @dev Internal function to revert if the a mint attempt occurs but
     *      minting is currently inactive.
     */
    function _assertMintActive() internal view {
        if (!mintActive) {
            revert MintInactive();
        }
    }
}

