pragma solidity 0.8.17;

/**
 * @title PLAYA3ULL Games Math Utility Library
 * @author Jourdan (PLAYA3ULL)
 * @notice This library contains utility functions for calculating
 *         various mathematical values that Solidity does not readily
 *         provide.
 */
library MathUtils {
    int256 internal constant SCALE = 1e18;
    
    ///
    /// @dev Hashes given string using keccak256
    ///
    function _hash(string memory _string) internal pure returns (bytes32) {
        return keccak256(abi.encodePacked(_string));
    }
    
    ///
    /// @dev Converts bytes16 to bytes32
    ///
    function _bytes16ToBytes32(bytes16 data) internal pure returns (bytes32 result) {
        result = bytes32 (data) & 0xFFFFFFFFFFFFFFFF000000000000000000000000000000000000000000000000 |
            (bytes32 (data) & 0x0000000000000000FFFFFFFFFFFFFFFF00000000000000000000000000000000) >> 64;
        result = result & 0xFFFFFFFF000000000000000000000000FFFFFFFF000000000000000000000000 |
            (result & 0x00000000FFFFFFFF000000000000000000000000FFFFFFFF0000000000000000) >> 32;
        result = result & 0xFFFF000000000000FFFF000000000000FFFF000000000000FFFF000000000000 |
            (result & 0x0000FFFF000000000000FFFF000000000000FFFF000000000000FFFF00000000) >> 16;
        result = result & 0xFF000000FF000000FF000000FF000000FF000000FF000000FF000000FF000000 |
            (result & 0x00FF000000FF000000FF000000FF000000FF000000FF000000FF000000FF0000) >> 8;
        result = (result & 0xF000F000F000F000F000F000F000F000F000F000F000F000F000F000F000F000) >> 4 |
            (result & 0x0F000F000F000F000F000F000F000F000F000F000F000F000F000F000F000F00) >> 8;
        result = bytes32 (0x3030303030303030303030303030303030303030303030303030303030303030 +
            uint256 (result) +
            (uint256 (result) + 0x0606060606060606060606060606060606060606060606060606060606060606 >> 4 &
            0x0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F0F) * 39);
    }
    
    ///
    /// @dev Converts bytes32 to a string
    ///
    function _bytes32ToString(bytes32 data) internal pure returns (string memory) {
        return string(abi.encodePacked(_bytes16ToBytes32(bytes16(data)), _bytes16ToBytes32(bytes16(data << 128))));
    }
    
    function mostSignificantBit(uint256 x) internal pure returns (uint256 msb) {
        if (x >= 2**128) {
            x >>= 128;
            msb += 128;
        }
        if (x >= 2**64) {
            x >>= 64;
            msb += 64;
        }
        if (x >= 2**32) {
            x >>= 32;
            msb += 32;
        }
        if (x >= 2**16) {
            x >>= 16;
            msb += 16;
        }
        if (x >= 2**8) {
            x >>= 8;
            msb += 8;
        }
        if (x >= 2**4) {
            x >>= 4;
            msb += 4;
        }
        if (x >= 2**2) {
            x >>= 2;
            msb += 2;
        }
        if (x >= 2**1) {
            // No need to shift x any more.
            msb += 1;
        }
    }
    
    function log2(int256 x) internal pure returns (int256 result) {
        require(x > 0, "PB MU: Input must be greater than 0!");
        unchecked {
            // This works because log2(x) = -log2(1/x).
            int256 sign;
            if (x >= SCALE) {
                sign = 1;
            } else {
                sign = -1;
                // Do the fixed-point inversion inline to save gas. The numerator is SCALE * SCALE.
                assembly {
                    x := div(1000000000000000000000000000000000000, x)
                }
            }

            // Calculate the integer part of the logarithm and add it to the result and finally calculate y = x * 2^(-n).
            uint256 n = mostSignificantBit(uint256(x / SCALE));

            // The integer part of the logarithm as a signed 59.18-decimal fixed-point number. The operation can't overflow
            // because n is maximum 255, SCALE is 1e18 and sign is either 1 or -1.
            result = int256(n) * SCALE;

            // This is y = x * 2^(-n).
            int256 y = x >> n;

            // If y = 1, the fractional part is zero.
            if (y == SCALE) {
                return result * sign;
            }

            // Calculate the fractional part via the iterative approximation.
            // The "delta >>= 1" part is equivalent to "delta /= 2", but shifting bits is faster.
            for (int256 delta = int256(SCALE / 2); delta > 0; delta >>= 1) {
                y = (y * y) / SCALE;

                // Is y^2 > 2 and so in the range [2,4)?
                if (y >= 2 * SCALE) {
                    // Add the 2^(-m) factor to the logarithm.
                    result += delta;

                    // Corresponds to z/2 on Wikipedia.
                    y >>= 1;
                }
            }
            result *= sign;
        }
    }


    function abs(int x) internal pure returns (uint256) {
        return x >= 0 ? uint256(x) : uint256(-x);
    }

    function max(uint256 a, uint256 b) internal pure returns (uint256) {
        return a >= b ? a : b;
    }

    function min(uint256 a, uint256 b) internal pure returns (uint256) {
        return a <= b ? a : b;
    }

    function canSub(uint256 a, uint256 b) internal pure returns (bool) {
        if (b > a) return (false);
        return (true);
    }
}

contracts/oracle/price/interfaces/IPrice.content:
pragma solidity 0.8.17;

/**
 * @title IPriceOracle
 * @author Jourdan (PLAYA3ULL)
 * @notice IPriceOracle contains all external functions, structs
 *         and events and errors for the Price Oracle.
 */
interface IPriceOracle {
    /**
     * @dev Emit an event whenever a token is set or updated.
     *
     * @param symbol The token symbol.
     */
    event TokenUpdated(string indexed symbol);

    /**
     * @dev Emit an event whenever a token pair's price is set
     *      or updated.
     *
     * @param symbolA The symbol of the `from` token.
     * @param symbolB The symbol of the `to`, or `in` token.
     * @param price   The new price of the tokenA in tokenB.
     */
    event PairPriceUpdated(
        string indexed symbolA,
        string indexed symbolB,
        uint256 price
    );

    /**
     * @dev Revert with an error when trying to set a token pair
     *      price that is zero or less.
     */
    error InvalidPrice();

    function getPriceIn(
        string memory tokenFrom,
        string memory tokenIn,
        uint256 price
    ) external view returns (uint256);

    function getPairPrice(
        string memory symbolA,
        string memory symbolB
    ) external view returns (uint256, uint256);
}

contracts/nft/bull/interfaces/I3ULLNFT.s.content:
pragma solidity 0.8.17;

/**
 * @title IPLAYA3ULLNFT
 * @author Jourdan (PLAYA3ULL)
 * @notice IPLAYA3ULLNFT contains all external functions and
 *         structs for the 3ULL NFT.
 */
interface IPLAYA3ULLNFT {

    /**
     * @dev An NFT contains two components: a string that
     *      represents that NFTs DNA, preventing any other
     *      token from using the same DNA, and an array of
     *      traits that the NFT is constructed from.
     */
    struct NFT {
        string dna;
        uint256[] traits;
    }

    /**
     * @dev A trait represents the different parts of the
     *      token. Each trait contains three components: 
     *      a name, whether it is required, and the maximum
     *      number of attributes that this trait may hold.
     */
    struct Trait {
        string name;
        bool required;
        uint256 maxCount;
    }

    /**
     * @dev An attribute belongs to a trait, and represents
     *      a different and unique variation of the parent
     *      trait. Each attribute contains three components:
     *      a name, a rarity value, and the number of this
     *      attribute that has sold.
     */
    struct Attribute {
        string name;
        uint256 rarity;
        uint256 numSold;
    }

    function getMaxSupply() external view returns (uint256);

    function getTotalSupply() external view returns (uint256);

    function getTraitLength() external view returns (uint256);
    
    function getTrait(uint256 traitId) external view returns (Trait memory);

    function getAttributeLength(uint256 traitId) external view returns (uint256);

    function getAttribute(uint256 traitId, uint256 attrId) external view returns (Attribute memory);

    function isDNAUnique(uint256[] memory traitIds) external view returns (bool isUnique, string memory dna);

    function mint(address to, uint256[] memory traitIds) external;
}

contracts/nft/bull/interfaces/I3ULLNFTMi.content:
pragma solidity 0.8.17;

/**
 * @title IPLAYA3ULLNFTMinterEventsAndErrors
 * @author Jourdan (PLAYA3ULL)
 * @notice IPLAYA3ULLNFTMinterEventsAndErrors contains all external events,
 *         and errors for the 3ULL NFT minter.
 */
interface IPLAYA3ULLNFTMinterEventsAndErrors {
    /**
     * @dev Emit an event whenever the owner updates the price.
     * 
     * @param price `The updated price.
     */
    event PriceUpdated(uint256 price);

    /**
     * @dev Emit an event whenever the owner toggles minting on,
     *      or off.
     * 
     * @param active    Whether minting is active or inactive.
     */
    event ToggledMinting(bool active);

    /**
     * @dev Revert with an error when providing an insufficient
     *      value when minting.
     * 
     * @param expected  The expected value for mint.
     */
    error InsufficientValueProvided(uint256 expected);

    /**
     * @dev Revert with an error when trying to withdraw balance
     *      that is greater than the balance of the contract.
     * 
     * @param balance   The true balance of the contract.
     */
    error NotEnoughFunds(uint256 balance);

    /**
     * @dev Revert with an error when trying to mint whilst the
     *      mint is inactive.
     */
    error MintInactive();

    /**
     * @dev Revert with an error when trying to mint a token, but
     *      providing incorrect trait ID bounds.
     * 
     * @param index The index of the trait that was out of bounds.
     * @param min   The minimum trait ID value.
     * @param max   The maximum trait ID value.
     */
    error TraitsOutOfBounds(uint256 index, uint256 min, uint256 max);
}

